Mazda is similar to:
 Chrysler in that it is a manufacturer of automobiles and is owned by a group of shareholders. It is a major manufacturer of vehicles and is a major player in the global auto industry. It is also a major shareholder in General Motors, which is a major player in the global auto industry.

In the United States, Mazda is one of the largest automakers with approximately 4.4 million vehicles sold. Mazda is also the largest passenger car manufacturer with approximately 1.3 million vehicles sold. Mazda is the largest producer of fuel-efficient vehicles in the United States.

